import styles from "./NavLanding.module.css";
import React, { useState, useEffect } from "react";

const NavLanding = () => {
  return (
    <div className={styles.container}>
      <ul className={styles.optionList}>
        <li>
          <h1>Omatic</h1>
        </li>
        <div>
          <li> twitter</li>
          <li> Discord</li>
        </div>
      </ul>
    </div>
  );
};

export default NavLanding;
